Have you ever looked forward to something for a really long time… then finally got it and been kind of dissipointed? Well think of that, then go for the complete opposite outcome!😂That’s what I got last week doing our maternity photos with @audie_jay !! He’s been one of my bucket list photographers since I started planning our wedding, but when we ended up getting married in Vegas instead of at home it didn’t work out. When I thought of maternity photos Audie was my first choice. I looked forward to this for so long… and was completely blown away! I can’t wait to share our other set… but really need to share baby J’s gender first, instead of letting my dress do it for me. 😂 For this set we went with Ron’s wedding outfit, a white gown for wedding vibes and brought back the sunglasses to recreate some of our favorite shots from last year. Oh the difference a year makes!!! 
{And props to my 6 year old for the shaky video clip! I realized after we got in our cars and started to leave that I wanted this and she came through.😂🙏🏽}
